import { useController } from '../Controller'

import { MovieDisplay } from '../components/MovieDisplay'

export function LandingPage() {
  const { movies } = useController()

  return (
    <div>
      <MovieDisplay movies={movies} />
      This is a Landing Page
    </div>
  )
}
